import React from 'react';
import { Router, Route, Switch } from 'react-router-dom';
import Header from './components/Header';
import Home from './pages/Home';
import StoryPage from './pages/StoryPage';

function App() {

  return (
    <Router>
      <div className="wrapper clear">
        <Header /> 
        <Switch>
          <Route exact path="/">
            <Home />
          </Route>
          <Route path="/story">
            <StoryPage />
          </Route>
        </Switch>
      </div>
    </Router>
  );
}

export default App;
